import * as React from 'react';
import * as PropTypes from 'prop-types';
import classNames from 'clsx';
import { styled } from '@mui/material/styles';

const PREFIX = 'Layout';
export const classes = {
  root: `${PREFIX}-root`,
};

const StyledDiv = styled('div')(() => ({
  [`&.${classes.root}`]: {
    display: 'flex',
    flexDirection: 'column',
  },
}));

export const Root = ({
  children, className, rootRef, ...restProps
}) => (
  <StyledDiv
    className={classNames(classes.root, className)}
    ref={rootRef}
    {...restProps}
  >
    {children}
  </StyledDiv>
);

Root.propTypes = {
  children: PropTypes.node.isRequired,
  className: PropTypes.string,
  rootRef: PropTypes.object,
};

Root.defaultProps = {
  className: undefined,
  rootRef: undefined,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import { Grid as GridBase } from '@devexpress/dx-react-grid';
import { Root } from './templates/layout';

export const Grid = ({ children, ...props }) => (
  <GridBase
    rootComponent={Root}
    {...props}
  >
    {children}
  </GridBase>
);

Grid.Root = Root;

Grid.propTypes = {
  children: PropTypes.node.isRequired,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import Popover from '@mui/material/Popover';

export const Overlay = ({
  visible, onHide, children, target, ...restProps
}) => (
  <Popover
    open={visible}
    anchorEl={target}
    onClose={onHide}
    anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
    transformOrigin={{ vertical: 'top', horizontal: 'right' }}
    {...restProps}
  >
    {children}
  </Popover>
);

Overlay.propTypes = {
  onHide: PropTypes.func.isRequired,
  children: PropTypes.node.isRequired,
  visible: PropTypes.bool,
  target: PropTypes.oneOfType([
    PropTypes.object,
    PropTypes.func,
  ]),
};

Overlay.defaultProps = {
  visible: false,
  target: null,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import List from '@mui/material/List';

export const Container = ({ children, ...restProps }) => (
  <List
    dense
    {...restProps}
  >
    {children}
  </List>
);

Container.propTypes = {
  children: PropTypes.node.isRequired,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import IconButton from '@mui/material/IconButton';
import Tooltip from '@mui/material/Tooltip';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

export const ToggleButton = ({
  onToggle, getMessage,
  buttonRef, active,
  ...restProps
}) => (
  <Tooltip
    title={getMessage('showColumnChooser')}
    placement="bottom"
    enterDelay={300}
  >
    <IconButton
      onClick={onToggle}
      ref={buttonRef}
      {...restProps}
      size="large"
    >
      <VisibilityOff />
    </IconButton>
  </Tooltip>
);

ToggleButton.propTypes = {
  onToggle: PropTypes.func.isRequired,
  getMessage: PropTypes.func.isRequired,
  buttonRef: PropTypes.func.isRequired,
  active: PropTypes.bool,
};

ToggleButton.defaultProps = {
  active: false,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Checkbox from '@mui/material/Checkbox';
import { styled } from '@mui/material/styles';

const PREFIX = 'Item';
export const classes = {
  checkbox: `${PREFIX}-checkbox`,
  itemText: `${PREFIX}-itemText`,
};

const StyledListItem = styled(ListItem)(({ theme }) => ({
  [`& .${classes.itemText}`]: {
    paddingLeft: theme.spacing(1),
  },
  [`& .${classes.checkbox}`]: {
    padding: 0,
  },
}));

export const Item = ({
  item: { column, hidden },
  disabled, onToggle,
  ...restProps
}) => (
  <StyledListItem
    key={column.name}
    button={!disabled}
    component="li"
    disabled={disabled}
    onClick={!disabled ? onToggle : null}
    {...restProps}
  >
    <Checkbox
      checked={!hidden}
      tabIndex={-1}
      disableRipple
      disabled={disabled}
      className={classes.checkbox}
    />
    <ListItemText className={classes.itemText} primary={column.title || column.name} />
  </StyledListItem>
);

Item.propTypes = {
  item: PropTypes.shape({
    column: PropTypes.shape({
      name: PropTypes.string,
      title: PropTypes.string,
    }),
    hidden: PropTypes.bool,
  }).isRequired,
  disabled: PropTypes.bool,
  onToggle: PropTypes.func,
};

Item.defaultProps = {
  onToggle: () => { },
  disabled: false,
};
import * as React from 'react';

export const withPatchedProps = patchProps => (Target) => {
  class Patched extends React.PureComponent {
    render() {
      return <Target {...patchProps(this.props)} />;
    }
  }
  return Patched;
};
import * as PropTypes from 'prop-types';
import { withComponents } from '@devexpress/dx-react-core';
import { ColumnChooser as ColumnChooserBase } from '@devexpress/dx-react-grid';
import { Overlay } from '../templates/column-chooser/overlay';
import { Container } from '../templates/column-chooser/container';
import { ToggleButton } from '../templates/column-chooser/toggle-button';
import { Item } from '../templates/column-chooser/item';
import { withPatchedProps } from '../utils/with-patched-props';

const defaultMessages = {
  showColumnChooser: 'Show Column Chooser',
};

const ColumnChooserWithMessages = withPatchedProps(({ messages, ...restProps }) => ({
  messages: { ...defaultMessages, ...messages },
  ...restProps,
}))(ColumnChooserBase);

ColumnChooserWithMessages.propTypes = {
  messages: PropTypes.shape({
    hiddenColumnNames: PropTypes.string,
  }),
};

ColumnChooserWithMessages.defaultProps = {
  messages: {},
};

ColumnChooserWithMessages.components = ColumnChooserBase.components;

export const ColumnChooser = withComponents({
  Container, Item, Overlay, ToggleButton,
})(ColumnChooserWithMessages);
import * as React from 'react';
import * as PropTypes from 'prop-types';
import classNames from 'clsx';
import Chip from '@mui/material/Chip';
import { styled } from '@mui/material/styles';

const PREFIX = 'DragDrop';
export const classes = {
  container: `${PREFIX}-container`,
  column: `${PREFIX}-column`,
};

const StyledDiv = styled('div')(() => ({
  [`&.${classes.container}`]: {
    position: 'fixed',
    zIndex: 1000,
    left: 0,
    top: 0,
    display: 'inline-block',
  },
}));

export const Container = ({
  clientOffset, style, className, children,
  ...restProps
}) => (
  <StyledDiv
    className={classNames(classes.container, className)}
    style={{
      transform: `translate(calc(${clientOffset.x}px - 50%), calc(${clientOffset.y}px - 50%))`,
      msTransform: `translateX(${clientOffset.x}px) translateX(-50%) translateY(${clientOffset.y}px) translateY(-50%)`,
      ...style,
    }}
    {...restProps}
  >
    {children}
  </StyledDiv>
);

Container.propTypes = {
  clientOffset: PropTypes.shape({
    x: PropTypes.number.isRequired,
    y: PropTypes.number.isRequired,
  }).isRequired,
  children: PropTypes.node,
  style: PropTypes.object,
  className: PropTypes.string,
};

Container.defaultProps = {
  style: null,
  className: undefined,
  children: undefined,
};

const StyledChip = styled(Chip)(({ theme }) => ({
  [`&.${classes.column}`]: {
    paddingLeft: theme.spacing(2),
    paddingRight: theme.spacing(2),
    float: 'right',
    cursor: 'move',
  },
}));

export const Column = React.memo(({
  column,
  className,
  ...restProps
}) => (
  <StyledChip
    className={classNames(classes.column, className)}
    label={column.title}
    {...restProps}
  />
));

Column.propTypes = {
  column: PropTypes.object.isRequired,
  className: PropTypes.string,
};

Column.defaultProps = {
  className: undefined,
};
import { withComponents } from '@devexpress/dx-react-core';
import { DragDropProvider as DragDropProviderBase } from '@devexpress/dx-react-grid';
import { Container, Column } from '../templates/drag-drop';

export const DragDropProvider = withComponents({ Container, Column })(DragDropProviderBase);
export const IS_LEGACY_EDGE_MEDIA_QUERY = '@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none)';
import * as React from 'react';
import * as PropTypes from 'prop-types';
import Input from '@mui/material/Input';
import MenuItem from '@mui/material/MenuItem';
import Select from '@mui/material/Select';
import { styled } from '@mui/material/styles';
import { IS_LEGACY_EDGE_MEDIA_QUERY } from '../constants';

const PREFIX = 'PageSizeSelector';
export const classes = {
  pageSizeSelector: `${PREFIX}-pageSizeSelector`,
  label: `${PREFIX}-label`,
  selectIcon: `${PREFIX}-selectIcon`,
  selectMenu: `${PREFIX}-selectMenu`,
  inputRoot: `${PREFIX}-inputRoot`,
};
const StyledDiv = styled('div')(({ theme }) => ({
  [`&.${classes.pageSizeSelector}`]: {
    ...theme.typography.caption,
    paddingRight: theme.spacing(5),
    // NOTE: fixes vertical alignment in FF
    display: 'flex',
    alignItems: 'center',
  },
  [`& .${classes.label}`]: {
    paddingRight: theme.spacing(3),
  },
  [`& .${classes.selectIcon}`]: {
    top: 2,
  },
  [`& .${classes.selectMenu}`]: {
    // NOTE: fix position for non-chromium Edge (issues 2234, 2788)
    [`${IS_LEGACY_EDGE_MEDIA_QUERY}`]: {
      position: 'absolute !important',
    },
  },
  [`& .${classes.inputRoot}`]: {
    fontSize: theme.spacing(1.75),
    textAlign: 'right',
  },
  '@media (max-width: 768px)': {
    [`&.${classes.pageSizeSelector}`]: {
      paddingRight: theme.spacing(2),
    },
    [`& .${classes.label}`]: {
      display: 'none',
    },
  },
}));

export const PageSizeSelector = ({
  pageSize,
  onPageSizeChange,
  pageSizes,
  getMessage,
}) => {
  const showAll = getMessage('showAll');
  return (
    <StyledDiv className={classes.pageSizeSelector}>
      <span className={classes.label}>
        {getMessage('rowsPerPage')}
      </span>
      <Select
        value={pageSize}
        onChange={event => onPageSizeChange(event.target.value)}
        classes={{
          icon: classes.selectIcon,
        }}
        MenuProps={{
          className: classes.selectMenu,
        }}
        input={(
          <Input
            disableUnderline
            classes={{ root: classes.inputRoot }}
          />
        )}
      >
        {pageSizes.map(item => (
          <MenuItem key={item} value={item}>
            {item !== 0 ? item : showAll }
          </MenuItem>
        ))}
      </Select>
    </StyledDiv>
  );
};

PageSizeSelector.propTypes = {
  pageSize: PropTypes.number.isRequired,
  onPageSizeChange: PropTypes.func.isRequired,
  pageSizes: PropTypes.arrayOf(PropTypes.number).isRequired,
  getMessage: PropTypes.func.isRequired,
};
import * as React from 'react';
import * as PropTypes from 'prop-types';
import classNames from 'clsx';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import { styled } from '@mui/material/styles';
import ChevronLeft from '@mui/icons-material/ChevronLeft';
import ChevronRight from '@mui/icons-material/ChevronRight';
import { firstRowOnPage, lastRowOnPage, calculateStartPage } from '@devexpress/dx-grid-core';

const PREFIX = 'Pagination';
export const classes = {
  button: `${PREFIX}-button`,
  activeButton: `${PREFIX}-activeButton`,
  text: `${PREFIX}-text`,
  pagination: `${PREFIX}-pagination`,
  rowsLabel: `${PREFIX}-rowsLabel`,
};
const StyledButton = styled(Button)(({ theme }) => ({
  [`&.${classes.button}`]: {
    minWidth: theme.spacing(2),
  },
  [`&.${classes.activeButton}`]: {
    fontWeight: 'bold',
    cursor: 'default',
  },
  [`&.${classes.text}`]: {
    color: 'rgba(0, 0, 0, 0.87)',
  },
  '@media(max-width: 768px)': {
    [`&.${classes.button}`]: {
      display: 'none',
    },
  },
}));

const StyledDiv = styled('div')(({ theme }) => ({
  [`&.${classes.pagination}`]: {
    margin: 0,
  },
  [`& .${classes.rowsLabel}`]: {
    ...theme.typography.caption,
    paddingRight: theme.spacing(5),
  },
  [`& .${classes.arrowButton}`]: {
    display: 'inline-block',
    transform: theme.direction === 'rtl' ? 'rotate(180deg)' : null,
    msTransform: theme.direction === 'rtl' ? 'rotate(180deg)' : null,
  },
  [`& .${classes.prev}`]: {
    marginRight: 0,
  },
  [`& .${classes.next}`]: {
    marginLeft: 0,
  },
  '@media(max-width: 768px)': {
    [`& .${classes.rowsLabel}`]: {
      paddingRight: theme.spacing(2),
    },
    [`& .${classes.prev}`]: {
      marginRight: theme.spacing(1),
    },
    [`& .${classes.next}`]: {
      marginLeft: theme.spacing(1),
    },
  },
}));

const PageButton = ({
  text, isActive, isDisabled, onClick,
}) => {
  const buttonClasses = classNames({
    [classes.button]: true,
    [classes.activeButton]: isActive,
    [classes.text]: true,
  });

  return (
    <StyledButton
      className={buttonClasses}
      disabled={isDisabled}
      onClick={onClick}
      {...isActive ? { tabIndex: -1 } : null}
    >
      {text}
    </StyledButton>
  );
};

PageButton.propTypes = {
  text: PropTypes.string.isRequired,
  isActive: PropTypes.bool,
  isDisabled: PropTypes.bool,
  onClick: PropTypes.func,
};

PageButton.defaultProps = {
  onClick: () => {},
  isDisabled: false,
  isActive: false,
};

const ellipsisSymbol = '\u2026';

const RenderPageButtons = (
  currentPage,
  totalPageCount,
  onCurrentPageChange,
) => {
  const pageButtons = [];
  const maxButtonCount = 3;
  let startPage = 1;
  let endPage = totalPageCount || 1;

  // NOTE: take into account last button and ellipsis (T1004797)
  if (maxButtonCount < totalPageCount - 2) {
    startPage = calculateStartPage(currentPage + 1, maxButtonCount, totalPageCount);
    endPage = (startPage + maxButtonCount) - 1;
  }
  if (startPage > 1) {
    pageButtons.push((
      <PageButton
        key={1}
        text={String(1)}
        onClick={() => onCurrentPageChange(0)}
      />
    ));

    if (startPage > 2) {
      pageButtons.push((
        <PageButton
          key="ellipsisStart"
          text={ellipsisSymbol}
          isDisabled
        />
      ));
    }
  }

  for (let page = startPage; page <= endPage; page += 1) {
    pageButtons.push((
      <PageButton
        key={page}
        text={String(page)}
        isActive={page === currentPage + 1}
        classes={classes}
        onClick={() => onCurrentPageChange(page - 1)}
        isDisabled={startPage === endPage}
      />
    ));
  }

  if (endPage < totalPageCount) {
    if (endPage < totalPageCount - 1) {
      pageButtons.push((
        <PageButton
          key="ellipsisEnd"
          text={ellipsisSymbol}
          classes={classes}
          isDisabled
        />
      ));
    }

    pageButtons.push((
      <PageButton
        key={totalPageCount}
        text={String(totalPageCount)}
